@-moz-document domain("wearenotonline.com") {
/* media="all" */
.x-navbar.x-navbar-fixed-left {
    background-color: #222222 !important;
    display: block;
    overflow: auto;
    
    box-shadow: 2px 0 3px #999;
}

.x-brand, .x-brand:hover, .x-navbar .desktop .x-nav > li > a, .x-navbar .desktop .sub-menu li > a, .x-navbar .mobile .x-nav li a {
    color: #CCC;
}


.x-navbar, .x-navbar .sub-menu, .x-navbar .sub-menu.a-menu-active {
    background-color: #222222 !important;
}


.x-brand, .x-brand:hover, .x-navbar .desktop .x-nav > li > a, .x-navbar .desktop .sub-menu li > a, .x-navbar .mobile .x-nav li a {
    color: #CCC !important;
}

#x-section-2{
	background-color: transparent !important;
    box-shadow: none;
    -webkit-box-shadow: none;
}
}
